import React, { Component } from 'react'

class Form extends Component {
    constructor(props) {
        super(props)
        this.state = {
            name: "",

        }
    }
    
    render() {
        return (
        <form id="hiddenForm" className="hiddenForm">
            <h1 className="m0">Add Details</h1>
            <p className="m0">Enter teacher's name</p>
            <input className="w" type="text"/>
            <p className="m0">Date</p>
            <input className="w" type="text"/>
            <p className="m0">Start Time</p>
            <input className="w" type="text"/>
            <p className="m0">End Time</p>
            <input className="w" type="text"/>
            <p className="m0">Task</p>
            <input className="w" type="text"/>
            <button onClick={()=>{
                var element = document.getElementById("hiddenForm");
                element.classList.add("hiddenForm");
                element.classList.remove();
            }}>Close</button>
        </form>
        )
    }
}

export default Form
